  `payment_mode` tinyint(4) DEFAULT NULL COMMENT '"0" =>Pay at Desk, "1"=>Full Payment, "2"=> Partial Payment ',
  `online_payment_percentage` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `at_desk_payment_percentage` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `cancellation_and_refund` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `min_hrs` int(11) DEFAULT NULL,
  `max_hrs` int(11) DEFAULT NULL,
  `min_hrs_percentage` int(11) DEFAULT NULL,
  `max_hrs_percentage` int(11) DEFAULT NULL,
  `tour_locations` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `tour_activities` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `tour_services_includes` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `tour_services_not_includes` text COLLATE utf8_unicode_ci DEFAULT NULL,
