  `user_city` varchar(30) CHARACTER SET latin1 DEFAULT NULL,
  `postal_code` int(11) DEFAULT NULL,
  `latitude` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `longitude` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `wallet_balance` int(11) DEFAULT 0,
  `address` text CHARACTER SET latin1 DEFAULT NULL,
  `alternate_num` varchar(20) DEFAULT NULL,
  `social_id` text CHARACTER SET latin1 DEFAULT NULL,
  `register_by` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `website` varchar(200) CHARACTER SET latin1 DEFAULT NULL,
  `device_id` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `device_token` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `device_type` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `vrfn_code` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `status` tinyint(4) DEFAULT 1,
  `user_signup_method` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `document_type` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `document_number` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
